import React, { Component } from 'react'
import Header from '../Home/Header'

export default class CheckoutPage extends Component {
    render() {
        return (
            <div>
               <Header/> 
               <div className="checkout">
                <div className="container">
                    <div className="row">   
                    </div>
                </div>
               </div>
            </div>
        )
    }
}
